import React from 'react';
import SkillBar from './SkillBar';
const Skills = () => {

// Skills.js

const skills = [
  {name: 'HTML', level: 90},
  {name: 'CSS', level: 80}, 
  {name: 'JavaScript', level: 70},
  {name: 'React', level: 60},
  {name: 'Django', level: 80},
  {name: 'jQuery', level: 60},
  {name: 'Bootstrap', level: 50},
  {name: 'Tailwind CSS', level: 30},

  { name: 'English', level: 90, lang: true },  
  { name: 'German', level: 30,lang: true },     
  { name: 'Arabic', level: 100, lang: true},
];

return (
  <div className="skills-container">
    <div className="hard-skills">
    <h2>Skills</h2>

      {skills.filter(skill => !skill.lang)  
      .map(skill => (      
        <SkillBar       
          key={skill.name}     
          name={skill.name}
          level={skill.level}    
        />     
      ))}   
    </div>

   <div className="language-skills">   
   <h2>Languages</h2>
      {skills  
        .filter(skill => skill.lang)      
        .map(skill => (    
          <SkillBar       
            key={skill.name}      
            name={skill.name}    
            level={skill.level}      
          />     
        ))}         
    </div>

  </div>
);
}

export default Skills;
